import { useState } from "react";

function ShowingVideos(props) {
  // Initialize the videos state with the value of props.result
  const [videos, setVideos] = useState(props.result);

  return (
    <>
      {/* Map through each video in the videos array */}
      {videos.map((video) => (
        <ul key={video.id}>
          {" "}
          {/* Use a unique key for each list item */}
          <li>
            <video src={video.url} controls></video>{" "}
            {/* Use the controls attribute to add video controls */}
          </li>
        </ul>
      ))}
    </>
  );
}

export default ShowingVideos;
